export default function CheckOut({ price }) {
    const tax = (price * 0.15).toFixed(2)
    const total = (parseFloat(price) + parseFloat(tax)).toFixed(2)
    return (
        <div className="checkOut">
            <span className="price">Subtotal: {price}</span>
            <span className="tax">Tax: {tax}</span>
            <span className="total">Total: {total}</span>
            <button className="checkOutButton">Delete Bag</button>
            <button className="checkOutButton"></button>
        </div>
    )
}
